import { useState,useEffect } from "react";
import axios from "axios"
const Api = () => {
    const [data,setData]=useState("");
    useEffect(() => {
        axios
          .get("https://jsonplaceholder.typicode.com/posts")
          .then((response) => {
            setData(response.data);
          })
          .catch((error) => {
            console.log(error.message);
          });
      }, []);

      return (
        <div>
          {data.map((a) => {
            return <h1>{a.title}</h1>;
          })}
        </div>
      );

}

export default Api
